import React from "react";
import Cabecera from "./components/Cabecera";
import "./App.css";

function App() {
  function manejaClick(texto) {
    console.log(texto);
  }
  const miau = "Bienvenido Miau";
  const guau = "Bienvenido Guau";
  return (
    <div className="App">
      <Cabecera miau={"Bienvenido miau"} manejaClick={manejaClick} />
      <Cabecera guau={"Bienvenido Guau"} manejaClick={manejaClick} />
    </div>
  );
}

export default App;
